import FourOhFour from '../components/FourOhFour'
import Home from '../components/Home'

export default function CustomPage(el) {

    if(el.name) {
        try {
            var dc = require('../components/custom-page/' + el.name + '.js');
            return dc.default();
        } catch (e) {
            return (
                <FourOhFour/>
            )
        }
    } else {
        return (
            <Home/>
        )
    }
}
